),(607,607,1,'Noise, Hearing Loss and Hearing Protection','tinnitus-therapy',NULL,'{\"6c77f445-0455-4050-ba36-5e9cf10efc94\": {\"type\": \"entry\", \"value\": \"{entry:200@1:url}\"}, \"c12c5cc9-3b6b-4341-acda-efa17882a7ee\": \"#c8df8a\"}',1,'2025-12-15 10:58:35','2025-12-15 10:58:35','cc5edc58-6017-417b-aac4-00e644c0073a'),(608,608,1,'Hearing loss cognitive decline',NULL,NULL,NULL,1,'2025-12-15 11:00:49','2025-12-15 11:00:49','a902efb6-ac81-4b85-82f2-7f4ce96d8c50'),(612,612,1,'Hearing for Health','hearing-for-health','hearing-for-health',NULL,1,'2025-12-15 11:00:58','2025-12-15 11:00:58','9e9ee6ff-7b1a-45c5-adca-65c8eb0230e3'),(613,613,1,'Hearing for Health','services',NULL,NULL,1,'2025-12-15 11:00:58','2025-12-15 11:00:58','1be085c8-0542-432a-805e-7315b168d5f1'),(614,614,1,'Hearing Loss and Cognitive Decline','wax-removal',NULL,'{\"084b381c-67b3-455a-a99b-9eae3e76d1ff\": [608], \"6c77f445-0455-4050-ba36-5e9cf10efc94\": {\"type\": \"entry\", \"value\": \"{entry:198@1:url}\"}, \"c12c5cc9-3b6b-4341-acda-efa17882a7ee\": \"#87d197\"}',1,'2025-12-15 11:00:58','2025-12-15 11:00:58','ccce6a66-e414-47fa-94dc-92e98adb1eac'),(617,617,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [608], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h1>Hearing loss and Cognitive Decline</h1><p>Recently there has been more and more coverage in the media suggesting a link between hearing loss, cognitive decline and possibly dementia. Some hearing aid companies have promoted their hearing aids will prevent dementia based on this claim. This leads to some of us believingthat if you dont get hearing aids, you will end up with dementia.While we do not want people to feel under pressure to wear hearing aids and the decision to go ahead with hearing aid fitting is completely your own, we have done our own investigation into the latest information on this topic.</p><p>In a study published in The Lancet called \'Dementia prevention, intervention, and care: 2020 report of the Lancet Commission\', they concluded that hearing aid use was the largest factor protecting cognitive decline. While hearing loss is not the only risk factor for onset of dementia it is a modifiable risk factor which can be helped with well fitted hearing aids.</p><p>In addition, there have been more studies reporting increased dementia in people with hearing loss except in those using hearing aids. If we add to that the additional benefits hearing aids can give to the overall quality of life, it is certainly of benefit to consider hearing aids as soon as an aidable hearing loss is detected.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\"}',1,'2025-12-15 11:02:03','2025-12-15 11:02:03','7ab34e89-c1a2-4c7a-b560-dcd35259079a'),(618,618,1,'Hearing Loss and Cognitive Decline','hearing-loss-and-cognitive-decline','hearing-for-health/hearing-loss-and-cognitive-decline',NULL,1,'2025-12-15 11:02:03','2025-12-15 11:02:03','1606a1a8-be60-4c1d-80ed-ab7df55bae07'),(619,619,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [608], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h1>Hearing loss and Cognitive Decline</h1><p>Recently there has been more and more coverage in the media suggesting a link between hearing loss, cognitive decline and possibly dementia. Some hearing aid companies have promoted their hearing aids will prevent dementia based on this claim. This leads to some of us believingthat if you dont get hearing aids, you will end up with dementia.While we do not want people to feel under pressure to wear hearing aids and the decision to go ahead with hearing aid fitting is completely your own, we have done our own investigation into the latest information on this topic.</p><p>In a study published in The Lancet called \'Dementia prevention, intervention, and care: 2020 report of the Lancet Commission\', they concluded that hearing aid use was the largest factor protecting cognitive decline. While hearing loss is not the only risk factor for onset of dementia it is a modifiable risk factor which can be helped with well fitted hearing aids.</p><p>In addition, there have been more studies reporting increased dementia in people with hearing loss except in those using hearing aids. If we add to that the additional benefits hearing aids can give to the overall quality of life, it is certainly of benefit to consider hearing aids as soon as an aidable hearing loss is detected.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\"}',1,'2025-12-15 11:02:03','2025-12-15 11:02:03','5f8c6e0b-177a-41b2-a8f1-86f93ca3de46'),(621,621,1,NULL,'__temp_ovkmscktzkulfdvynpwclcxvhksjelagxyeu',NULL,NULL,1,'2025-12-15 11:06:31','2025-12-15 11:06:31','03d66537-dcd3-4a19-bfb7-84b44049c48a'),(623,623,1,'Ear diagram',NULL,NULL,NULL,1,'2025-12-15 11:10:37','2025-12-15 11:10:37','2f9ab5e1-7424-4af8-82ac-377cd57247f6'),(624,624,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [623], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h2>How We Hear</h2><h3>Parts of the ear</h3><p>Our ears are made up of 3 parts:</p><ol><li>The outer ear comprised of the visible pinna and ear canal.</li><li>The middle ear which includes the ear drum and middle ear cavity housing the 3 tiny bones called the ossicles.</li><li>The inner ear or cochlea</li></ol><h3>How do our ears work?</h3><p>Sound waves are captured into the ear via the ear lobe. As the sound travels into the ear canal, it vibrates the ear drum. These vibrations then travel via the ossicle bones to the cochlea. The cochlea is filled with fluid that carries the vibrations like waves to tiny hair cells which are tuned to a particular pitch. When the hair cells move in the fluid, they send a message through to the auditory nerve which is connected to the brain.</p><p>Each section of the ear must be working properly for this process to happen. Our full Diagnostic Hearing assessment assesses each of the sections of the ear so if a hearing loss is detected we can help determine the cause of the hearing loss.</p><h3>Types of Hearing Loss</h3><ul><li><strong>Conductive Hearing loss</strong>  this occurs whenthe sound being transferred through the middle ear to the cochlea is reduced. It can be caused by wax in the outer ear, fluid in the middle ear, abnormality of the middle ear bones or issues with the ear drum.<br />Usually these hearing losses are temporary and can sometimes resolve on their own. In some cases further intervention such as surgery may be an option. Your Audiologist will advise if referral to an Ear, Nose and Throat (ENT) is warranted.</li><li><strong>Sensorineural hearing loss</strong>  this is where the nerve fibres in the inner ear are damaged. This can be due to noise exposure, medication, trauma or age. This is the most common type of hearing loss in adults. It is permanent and can vary in degree from mild to profound. In Australia it is estimated that 1 in 3 adults over the age of 60 have a hearing loss. Of those, less than 50% have had a hearing test and wear appropriately fitted hearing aids.</li><li><strong>Mixed hearing loss</strong>  this is when the hearing loss is a combination of sensorineural and conductive.</li></ul>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\"}',1,'2025-12-15 11:13:20','2025-12-15 11:17:18','8c099087-ab45-4c2f-982a-d19273944c3b'),(625,625,1,'How We Hear','how-we-hear','hearing-for-health/how-we-hear',NULL,1,'2025-12-15 11:13:20','2025-12-15 11:13:20','3e379f47-1dfe-428e-9c07-14c593e6345a'),(626,626,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [623], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h1>How We Hear</h1><h2>Parts of the ear</h2><p>Our ears are made up of 3 parts:</p><p>The outer ear comprised of the visible pinna and ear canal.</p><p>The middle ear which includes the ear drum and middle ear cavity housing the 3 tiny bones called the ossicles.</p><p>The inner ear or cochlea</p><h2>How do our ears work?</h2><p>Sound waves are captured into the ear via the ear lobe. As the sound travels into the ear canal, it vibrates the ear drum. These vibrations then travel via the ossicle bones to the cochlea. The cochlea is filled with fluid that carries the vibrations like waves to tiny hair cells which are tuned to a particular pitch. When the hair cells move in the fluid, they send a message through to the auditory nerve which is connected to the brain.</p><p>Each section of the ear must be working properly for this process to happen. Our full Diagnostic Hearing assessment assesses each of the sections of the ear so if a hearing loss is detected we can help determine the cause of the hearing loss.</p><h2>Types of Hearing Loss</h2><ul><li><strong>Conductive Hearing loss</strong>  this occurs whenthe sound being transferred through the middle ear to the cochlea is reduced. It can be caused by wax in the outer ear, fluid in the middle ear, abnormality of the middle ear bones or issues with the ear drum.<br /><br />Usually these hearing losses are temporary and can sometimes resolve on their own. In some cases further intervention such as surgery may be an option. Your Audiologist will advise if referral to an Ear, Nose and Throat (ENT) is warranted.</li><li><strong>Sensorineural hearing loss</strong>  this is where the nerve fibres in the inner ear are damaged. This can be due to noise exposure, medication, trauma or age. This is the most common type of hearing loss in adults. It is permanent and can vary in degree from mild to profound. In Australia it is estimated that 1 in 3 adults over the age of 60 have a hearing loss. Of those, less than 50% have had a hearing test and wear appropriately fitted hearing aids.</li><li><strong>Mixed hearing loss</strong>  this is when the hearing loss is a combination of sensorineural and conductive.</li></ul>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\"}',1,'2025-12-15 11:13:20','2025-12-15 11:13:20','c115a2ab-7907-4ff0-b07a-01e71f72eb8a'),(629,629,1,'How We Hear','how-we-hear','hearing-for-health/how-we-hear',NUL