aring for Health','hearing-for-health','hearing-for-health',NULL,1,'2025-12-16 09:09:02','2025-12-16 09:09:02','721fb0ae-67db-4cef-bad7-f64824a303b5'),(650,650,1,NULL,'services',NULL,NULL,1,'2025-12-16 09:09:02','2025-12-16 09:09:02','c445d6a4-2abf-467d-95e0-4767bf5befec'),(653,653,1,'Funding Options','funding','funding',NULL,1,'2025-12-16 09:09:24','2025-12-16 09:09:24','ea9bebb4-9b88-43d2-a1b7-d6524ab48c3c'),(654,654,1,NULL,'funding-options',NULL,'{\"5f8f84f5-06d0-4eda-83ca-2403830873c6\": \"logo\", \"ea005bfa-5e15-4b1f-9474-c4927c9653f5\": 2}',1,'2025-12-16 09:09:24','2025-12-16 09:09:24','dedb2d65-b841-45d7-ba7e-b0933599a8b7'),(657,657,1,'Contact us','contact-us','contact-us',NULL,1,'2025-12-16 09:10:22','2025-12-16 09:10:22','fc597575-2509-4250-a4ee-6df623ea6ac5'),(658,658,1,NULL,NULL,NULL,'{\"3bdce705-01c8-430d-9803-399475ce8db0\": \"<p style=\\\"text-align:center;\\\">Phone <a href=\\\"tel:+61359552013\\\">03 5955 2013</a> Fax <a href=\\\"tel:+61361216162\\\">03 6121 6162</a> Email <a href=\\\"mailto:info@mpaud.com.au\\\">info@mpaud.com.au</a></p>\"}',1,'2025-12-16 09:10:22','2025-12-16 09:10:22','a4337757-0f93-42fb-98d8-59f3b326023e'),(663,663,1,'Diagnostic Hearing Assessments MPA provide hearing assessments for each age and stage of development 6 months and above','diagnostic-hearing-assessments-mpa-provide-hearing-assessments-for-each-age-and-stage-of-development-6-months-and-above',NULL,'{\"5f8f84f5-06d0-4eda-83ca-2403830873c6\": \"photo\", \"ea005bfa-5e15-4b1f-9474-c4927c9653f5\": 2}',1,'2025-12-16 09:13:56','2025-12-16 09:13:56','668222b2-3395-4dbf-988e-e55534be50b6'),(664,664,1,'6 months - 3 years','6-months-3-years',NULL,'{\"86f5c4bd-86f3-4cc5-95d0-c54c111fb766\": \"<p><strong>Visual Reinforcement Audiometry</strong> is a hearing test technique for children aged from 6 months to approximately 3 years. The child sits on the parent\'s knee in the sound proof booth. The Audiologist will present sounds through speakers on either side of the child and will look for a behavioural response, typically a head turn to the sound. The Audiologist will then reinforce that behaviour with a puppet or animated screen to reward the child for responding to the sound.</p>\"}',1,'2025-12-16 09:13:56','2025-12-16 09:13:56','7b3551d7-18cd-4c84-aa30-3195f6d1ec13'),(665,665,1,NULL,NULL,NULL,NULL,1,'2025-12-16 09:13:56','2025-12-16 09:13:56','d44d3c0b-0f98-4a37-a1cd-c8906f9da7c4'),(666,666,1,'Diagnostics Hearing Assessments','diagnostics-hearing-assessments','services/diagnostics-hearing-assessments',NULL,1,'2025-12-16 09:13:56','2025-12-16 09:13:56','e7563344-9997-464d-b085-a0502ef96d24'),(667,667,1,'Diagnostic Hearing Assessments MPA provide hearing assessments for each age and stage of development 6 months and above','diagnostic-hearing-assessments-mpa-provide-hearing-assessments-for-each-age-and-stage-of-development-6-months-and-above',NULL,'{\"5f8f84f5-06d0-4eda-83ca-2403830873c6\": \"photo\", \"ea005bfa-5e15-4b1f-9474-c4927c9653f5\": 2}',1,'2025-12-16 09:13:56','2025-12-16 09:13:56','b20be9b0-1c4a-4b4c-88b7-09b2ba3d1938'),(668,668,1,'6 months - 3 years','6-months-3-years',NULL,'{\"86f5c4bd-86f3-4cc5-95d0-c54c111fb766\": \"<p><strong>Visual Reinforcement Audiometry</strong> is a hearing test technique for children aged from 6 months to approximately 3 years. The child sits on the parent\'s knee in the sound proof booth. The Audiologist will present sounds through speakers on either side of the child and will look for a behavioural response, typically a head turn to the sound. The Audiologist will then reinforce that behaviour with a puppet or animated screen to reward the child for responding to the sound.</p>\"}',1,'2025-12-16 09:13:56','2025-12-16 09:13:56','012c44e7-2b06-4193-af06-d6b5fa0c5e2d'),(669,669,1,NULL,NULL,NULL,NULL,1,'2025-12-16 09:13:56','2025-12-16 09:13:56','fbf074b0-33d1-4c54-b713-4fb508565cc3'),(697,697,1,NULL,NULL,NULL,'{\"3bdce705-01c8-430d-9803-399475ce8db0\": \"<p style=\\\"text-align:center;\\\">Diagnostic Hearing Assessments MPA provide hearing assessments for each age and stage of development 6 months and above.</p>\"}',1,'2025-12-16 09:16:56','2025-12-16 09:18:36','81d4258c-f0dc-438a-ae9c-63806a693af4'),(698,698,1,NULL,'diagnostic-hearing-assessments-mpa-provide-hearing-assessments-for-each-age-and-stage-of-development-6-months-and-above',NULL,'{\"5f8f84f5-06d0-4eda-83ca-2403830873c6\": \"photo\", \"ea005bfa-5e15-4b1f-9474-c4927c9653f5\": 2}',1,'2025-12-16 09:16:56','2025-12-16 09:16:56','2515866d-6631-4ed1-814c-60975a0b471d'),(699,699,1,'6 months - 3 years','6-months-3-years',NULL,'{\"86f5c4bd-86f3-4cc5-95d0-c54c111fb766\": \"<p><strong>Visual Reinforcement Audiometry</strong> is a hearing test technique for children aged from 6 months to approximately 3 years. The child sits on the parent\'s knee in the sound proof booth. The Audiologist will present sounds through speakers on either side of the child and will look for a behavioural response, typically a head turn to the sound. The Audiologist will then reinforce that behaviour with a puppet or animated screen to reward the child for responding to the sound.</p>\"}',1,'2025-12-16 09:16:56','2025-12-16 09:16:56','607f3b07-9280-4a75-9fde-ef435b7be4c2'),(700,700,1,NULL,NULL,NULL,NULL,1,'2025-12-16 09:16:56','2025-12-16 09:16:56','8f536261-3136-4d7d-869f-ff6bc6398eed'),(701,701,1,'3 years - 6 years','6-months-3-years',NULL,'{\"86f5c4bd-86f3-4cc5-95d0-c54c111fb766\": \"<p><strong>Play Audiometry</strong> is a hearing test technique used for children from around 3 years to around 6 years. It involves teaching a child a listening game where he/she will perform an action in response to the sound. The action may be putting a peg in a board or a dinosaur in a bucket. The child must wait until the sound is heard before performing the action. The Audiologist will ensure the child understands the concept of the game before attempting to place headphones on their ears.</p>\"}',1,'2025-12-16 09:16:56','2025-12-16 09:16:56','fd29a2fc-53dc-4cef-9659-ee32e01ca2cd'),(702,702,1,NULL,NULL,NULL,NULL,1,'2025-12-16 09:16:56','2025-12-16 09:16:56','9ee4e392-3f68-49ae-9c23-4f42e08f1a16'),(703,703,1,'6 years +','6-years',NULL,'{\"86f5c4bd-86f3-4cc5-95d0-c54c111fb766\": \"<p><strong>Pure Audiometry</strong> is a hearing test technique for children and adults 6 years and above. The patient is seated in the sound proof booth with headphones on and will press a buzzer when they hear a tone. The Audiologist will test both ears across a whole range of frequencies to determine the individual\'s threshold or softest sound they can hear for both ears.</p>\"}',1,'2025-12-16 09:16:56','2025-12-16 09:16:56','7cac4340-4bc9-49ab-a954-61d11d9e37d2'),(704,704,1,NULL,NULL,NULL,NULL,1,'2025-12-16 09:16:56','2025-12-16 09:16:56','b79ed8ae-e8b9-47f4-b584-573a5cddd13a'),(705,705,1,'Tympanometry','tympanometry',NULL,'{\"86f5c4bd-86f3-4cc5-95d0-c54c111fb766\": \"<p>Tympanometry is a quick test we perform on all ages as a standard component of a routine assessment. The test measures the function of the middle ear system by gently pushing some air into the ear. This objective test allows us to see how well the ear drum is moving. This test can provide information about the status of the middle ear such as whether there is presence of otitis media or \'glue ear\' , whether a ventilation tube or grommet is clear or whether the bones in the middle ear are moving adequately. It can also detect blockage in the eustachian tube, perforations of the ear drum or other middle ear abnormalities.</p>\"}',1,'2025-12-16 09:16:56','2025-12-16 09:16:56','ecc8f0d2-1797-458f-ae9b-e2e34083a2d1'),(706,706,1,NULL,NULL,NULL,NULL,1,'2025-12-16 09:16:56','2025-12-16 09:16:56','bcca3427-63c9-490f-983a-31fe1711298d'),(707,707,1,'Speech testing','speech-testing',NULL,'{\"86f5c4bd-86f3-4cc5-95d0-c54c111fb766\": \"<p>Speech testing is another component of a standard hearing assessment at MPA. It is used to check the reliability of the hearing test and assesses the individual\'s speech perception abilities. Younger children are assessed using a picture pointing task whereas older children and adults are asked to repeat words using a recorded voice.</p>\"}',1,'2025-12-16 09:16:56','2025-12-16 09:16:56','3e6fb6a4-212b-46d9-b8e0-b93b5bd1cd17'),(708,708,1,NULL,NULL,NULL,NULL,1,'2025-12-16 09:16:56','2025-12-16 09:16:56','f988dcd0-a7ce-4a16-b80a-6b69916c2cb4'),(709,709,1,'Otoacoustic Emissions','otoacoustic-emissions',NULL,'{\"86f5c4bd-86f3-4cc5-95d0-c54c111fb766\": \"<p>Otoacoustic Emissions (OAEs) are a measure of the hair cell function in the inner ear. The Audiologist places a probe in the ear which produces sound into the ear. The probe then detects the sounds that comes back or the \'echo\' of the sound. If all the parts of the ear including the middle ear and the tiny inner hair cells are functioning normally, the ear will produce a recordable echo of the sound. The patient does not need to respond to the sound so it is an objective hearing assessment which can be performed to obtain additional information about the function of the ear.</p>\"}',1,'2025-12-16 09:16:56','2025-12-16 09:16:56','068554c4-739f-45a0-a103-deb1eec65ed1'),(710,710,1,NULL,NULL,NULL,NULL,1,'2025-12-16 09:16:56','2025-12-16 09:16:56','195c57e8-da3b-492e-9da7-3299e8d3979b'),(711,711,1,'Diagnostics Hearing Assessments','diagnostics-hearing-assessments','services/diagnostics-hearing-assessments',NULL,1,'2025-12-16 09:16:56','2025-12-16 09:16:56','5a95092c-1b3d-4bf0-aab1-f0e82cefb254'),(712,712,1,NULL,NULL,NULL,'{\"3bdce705-01c8-430d-9803-399475ce8db0\": \"<p style=\\\"text-align:center;\\\"><strong>Diagnostic Hearing Assessments MPA provide hearing assessments for each age and stage of development 6 months and above.</strong></p>\"}',1,'2025-12-16 09:16:56','2025-12-16 09:16:56','5e7542ad-07d3-442c-b8c0-89c1ae6dce21'),(713,713,1,NULL,'diagnostic-hearing-assessments-mpa-provide-hearing-assessments-for-each-age-and-stage-of-development-6-months-and-above',NULL,'{\"5f8f84f5-06d0-4eda-83ca-2403830873c6\": \"photo\", \"ea005bfa-5e15-4b1f-9474-c4927c9653f5\": 2}',1,'2025-12-16 09:16:56','2025-12-16 09:16:56','3be41530-e149-4b75-8628-4d96ce2783b8'),(714,714,1,'6 months - 3 years','6-months-3-years',NULL,'{\"86f5c4bd-86f3-4cc5-95d0-c54c111fb766\": \"<p><strong>Visual Reinforcement Audiometry</strong> is a hearing test technique for children aged from 6 months to approximately 3 years. The child sits on the parent\'s knee in the sound proof booth. The Audiologist will present sounds through speakers on either side of the child and will look for a behavioural response, typically a head turn to the sound. The Audiologist will then reinforce that behaviour with a puppet or animated screen to reward the child for responding to the sound.</p>\"}',1,'2025-12-16 09:16:56','2025-12-16 09:16:56','8c829910-6e18-42d1-a677-8453331724e2'),(715,715,1,NULL,NULL,NULL,NULL,1,'2025-12-16 09:16:56','2025-12-16 09:16:56','3ecd20ce-9d74-4f00-b907-c9ecc254fe61'),(716,716,1,'3 years - 6 years','6-months-3-years',NULL,'{\"86f5c4bd-86f3-4cc5-95d0-c54c111fb766\": \"<p><strong>Play Audiometry</strong> is a hearing test technique used for children from around 3 years to around 6 years. It involves teaching a child a listening game where he/she will perform an action in response to the sound. The action may be putting a peg in a board or a dinosaur in a bucket. The child must wait until the sound is heard before performing the action. The Audiologist will ensure the child understands the concept of the game before attempting to place headphones on their ears.</p>\"}',1,'2025-12-16 09:16:56','2025-12-16 09:16:56','ad8621c4-f7b7-458b-9f3d-df116e7aab66'),(717,717,1,NULL,NULL,NULL,NULL,1,'2025-12-16 09:16:56','2025-12-16 09:16:56','01252ace-48dc-4580-b83c-1e42f2aa8415'),(718,718,1,'6 years +','6-years',NULL,'{\"86f5c4bd-86f3-4cc5-95d0-c54c111fb766\": \"<p><strong>Pure Audiometry</strong> is a hearing test technique for children and adults 6 years and above. The patient is seated in the sound proof booth with headphones on and will press a buzzer when they hear a tone. The Audiologist will test both ears across a whole range of frequencies to determine the individual\'s threshold or softest sound they can hear for both ears.</p>\"}',1,'2025-12-16 09:16:56','2025-12-16 09:16:56','80a5e53b-2ba3-4a99-a038-d5a679f6d2da'),(719,719,1,NULL,NULL,NULL,NULL,1,'2025-12-16 09:16:56','2025-12-16 09:16:56','77ca7d50-1fb8-4a79-8183-108e5abad4f6'),(720,720,1,'Tympanometry','tympanometry',NULL,'{\"86f5c4bd-86f3-4cc5-95d0-c54c111fb766\": \"<p>Tympanometry is a quick test we perform on all ages as a standard component of a routine assessment. The test measures the function of the middle ear system by gently pushing some air into the ear. This objective test allows us to see how well the ear drum is moving. This test can provide information about the status of the middle ear such as whether there is presence of otitis media or \'glue ear\' , whether a ventilation tube or grommet is clear or whether the bones in the middle ear are moving adequately. It can also detect blockage in the eustachian tube, perforations of the ear drum or other middle ear abnormalities.</p>\"}',1,'2025-12-16 09:16:56','2025-12-16 09:16:56','c45aaadd-57f7-4af2-999d-3bd86780b78c'),(721,721,1,NULL,NULL,NULL,NULL,1,'2025-12-16 09:16:56','2025-12-16 09:16:56','0913d6e1-2f7e-40ba-8f72-c74abac23bc4'),(722,722,1,'Speech testing','speech-testing',NULL,'{\"86f5c4bd-86f3-4cc5-95d0-c54c111fb766\": \"<p>Speech testing is another component of a standard hearing assessment at MPA. It is used to check the reliability of the hearing test and assesses the individual\'s speech perception abilities. Younger children are assessed using a picture pointing task whereas older children and adults are asked to repeat words using a recorded voice.</p>\"}',1,'2025-12-16 09:16:56','2025-12-16 09:16:56','afc99283-be47-4c33-9d6e-293982c51eba'),(723,723,1,NULL,NULL,NULL,NULL,1,'2025-12-16 09:16:56','2025-12-16 09:16:56','12a4953b-fb05-4bcb-a0d0-b04e0f18e0e1'),(724,724,1,'Otoacoustic Emissions','otoacoustic-emissions',NULL,'{\"86f5c4bd-86f3-4cc5-95d0-c54c111fb766\": \"<p>Otoacoustic Emissions (OAEs) are a measure of the hair cell function in the inner ear. The Audiologist places a probe in the ear which produces sound into the ear. The probe then detects the sounds that comes back or the \'echo\' of the sound. If all the parts of the ear including the middle ear and the tiny inner hair cells are functioning normally, the ear will produce a recordable echo of the sound. The patient does not need to respond to the sound so it is an objective hearing assessment which can be performed to obtain additional information about the function of the ear.</p>\"}',1,'2025-12-16 09:16:56','2025-12-16 09:16:56','6457dbd9-0d6d-4ae5-a5da-ec0dc39e89a7'),(725,725,1,NULL,NULL,NULL,NULL,1,'2025-12-16 09:16:56','2025-12-16 09:16:56','f86a9b81-e788-46f5-bf6f-63d07db23472'),(728,728,1,'Diagnostics Hearing Assessments','diagnostics-hearing-assessments','services/diagnostics-hearing-assessments',NULL,1,'2025-12-16 09:18:36','2025-12-16 09:18:36','1b6167a5-dfe1-4216-a94f-4779eef12a98'),(729,729,1,NULL,NULL,NULL,'{\"3bdce705-01c8-430d-9803-399475ce8db0\": \"<p style=\\\"text-align:center;\\\">Diagnostic Hearing Assessments MPA provide hearing assessments for each age and stage of development 6 months and above.</p>\"}',1,'2025-12-16 09:18:36','2025-12-16 09:18:36','99516067-9de4-4186-b28a-bbfaea3e120c'),(732,732,1,'Hearing aids table',NULL,NULL,NULL,1,'2025-12-16 09:35:19','2025-12-16 09:35:19','f13a76f6-bdf9-4644-9364-6c2ef512e374'),(734,734,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [732], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<p>MPA is a proudly independent audiology practice with no affiliation with any hearing aid manufacturers. This means we can choose your hearing device to meet your individual needs.</p><p>Following a comprehensive hearing assessment, your Audiologist will discuss whether a hearing aid would be suitable for you. They will then take you through the many different hearing solutions based on your lifestyle, budget and choice.</p><p>A trial period can be arranged to ensure you are satisfied with the device/s before you buy.</p><p>MPA Audiologists are approved to fit hearing aids under the Workcover and Hearing Services Programs.</p><p><a href=\\\"{entry:184@1:url||https://mpaud.ddev.site/solutions/hearing-aids}\\\">Read more</a></p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\"}',1,'2025-12-16 09:35:27','2025-12-16 09:35:43','77aef26c-4a1b-408e-8362-06bfc407d2b4'),(735,735,1,'Hearing Aids','hearing-aids','services/hearing-aids',NULL,1,'2025-12-16 09:35:27','2025-12-16 09:35:27','94f1ee9b-44fb-4684-b7d4-7cf2f7da2af2'),(736,736,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [732], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<p>MPA is a proudly independent audiology practice with no affiliation with any hearing aid manufacturers. This means we can choose your hearing device to meet your individual needs.</p><p>Following a comprehensive hearing assessment, your Audiologist will discuss whether a hearing aid would be suitable for you. They will then take you through the many different hearing solutions based on your lifestyle, budget and choice.</p><p>A trial period can be arranged to ensure you are satisfied with the device/s before you buy.</p><p>MPA Audiologists are approved to fit hearing aids under the Workcover and Hearing Services Programs.</p><p><a href=\\\"{entry:184@1:url||https://mpaud.ddev.site/solutions/hearing-aids}\\\">Read more</a></p>\"}',1,'2025-12-16 09:35:27','2025-12-16 09:35:27','1a7c6587-7c90-4278-bfc3-4fb76261b011'),(739,739,1,'Hearing Aids','hearing-aids','services/hearing-aids',NULL,1,'2025-12-16 09:35:43','2025-12-16 09:35:43','2e64d622-d6d3-4b2e-a016-38b1cb6b2afa'),(740,740,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [732], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<p>MPA is a proudly independent audiology practice with no affiliation with any hearing aid manufacturers. This means we can choose your hearing device to meet your individual needs.</p><p>Following a comprehensive hearing assessment, your Audiologist will discuss whether a hearing aid would be suitable for you. They will then take you through the many different hearing solutions based on your lifestyle, budget and choice.</p><p>A trial period can be arranged to ensure you are satisfied with the device/s before you buy.</p><p>MPA Audiologists are approved to fit hearing aids under the Workcover and Hearing Services Programs.</p><p><a href=\\\"{entry:184@1:url||https://mpaud.ddev.site/solutions/hearing-aids}\\\">Read more</a></p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\"}',1,'2025-12-16 09:35:43','2025-12-16 09:35:43','292bb3f7-58bc-40ed-beca-13ff84a22b5f'),(743,743,1,'Hearing 4 learning',NULL,NULL,NULL,1,'2025-12-16 09:42:22','2025-12-16 09:42:22','6c93f10e-a864-43df-bc38-b3de0f3e28dd'),(744,744,1,'Classroom',NULL,NULL,NULL,1,'2025-12-16 09:42:23','2025-12-16 09:42:23','da069ee6-e454-4075-b11e-67aebbc6cf90'),(747,747,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [744], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h2>Hearing 4 Learning</h2><p>Educational Audiology assessments are available at our newest clinic at MPA, Hearing 4 Learning. Our clinicians, each with over 20 years experience in Paediatric Audiology have a special interest in Educational Audiology, working with the children along with parents and teachers to ensure an optimal listening environment for the childs learning.</p><h3>What is Auditory Processing Disorder?</h3><p>Auditory Processing Disorder is defined as a hearing deficit where the brain has difficulty understanding speech and other sounds in the environment. Children with APD most commonly report difficulty listening in noisy environments, however, it is more often learning delays or difficulties in the classroom that will trigger a referral for APD assessment</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-16 09:43:36','2025-12-16 09:47:05','19a0bc14-6128-4a42-b7a8-716eb79e80b7'),(748,748,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [743], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<p>If children are referred for an APD assessment, a comprehensive hearing assessment including pure tone audiometry, tympanometry and speech discrimination in quiet are performed to ensure normal hearing and healthy middle ears. The APD assessment then involves various tests to check the child\'s ability to listen to information presented simultaneously to both ears, their ability to hear in background noise and their ability to detect subtle differences in sound.</p><p>Using the information from the APD assessment, feedback from the childs teachers, parents and other specialists, a written report will be supplied with recommendations for management and/or intervention as appropriate. We accept all referrals for APD assessment; however, a medical referral will also be required to enable Medicare rebate for the hearing assessment.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"logo\"}',1,'2025-12-16 09:43:36','2025-12-16 09:47:05','b8b02695-82ee-4406-979b-50d7d8bb6a61'),(749,749,1,'Auditory Processing Assessment','auditory-processing-assessment','services/auditory-processing-assessment',NULL,1,'2025-12-16 09:43:36','2025-12-16 09:43:36','eb9a3ce6-e47f-454b-9c68-545780394ff2'),(750,750,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [744], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h2>Hearing 4 Learning</h2><p>Educational Audiology assessments are available at our newest clinic at MPA, Hearing 4 Learning. Our clinicians, each with over 20 years experience in Paediatric Audiology have a special interest in Educational Audiology, working with the children along with parents and teachers to ensure an optimal listening environment for the childs learning.</p><h3>What is Auditory Processing Disorder?</h3><p>Auditory Processing Disorder is defined as a hearing deficit where the brain has difficulty understanding speech and other sounds in the environment. Children with APD most commonly report difficulty listening in noisy environments, however, it is more often learning delays or difficulties in the classroom that will trigger a referral for APD assessment</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\"}',1,'2025-12-16 09:43:36','2025-12-16 09:43:36','cdd713d8-abec-4d38-a889-5f1028e3ce28'),(751,751,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [743], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<p>If children are referred for an APD assessment, a comprehensive hearing assessment including pure tone audiometry, tympanometry and speech discrimination in quiet are performed to ensure normal hearing and healthy middle ears. The APD assessment then involves various tests to check the child\'s ability to listen to information presented simultaneously to both ears, their ability to hear in background noise and their ability to detect subtle differences in sound.</p><p>Using the information from the APD assessment, feedback from the childs teachers, parents and other specialists, a written report will be supplied with recommendations for management and/or intervention as appropriate. We accept all referrals for APD assessment; however, a medical referral will also be required to enable Medicare rebate for the hearing assessment.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"left\"}',1,'2025-12-16 09:43:36','2025-12-16 09:43:36','62ad720f-5a99-426c-9ad7-cbaa1454a602'),(754,754,1,'Auditory Processing Assessment','auditory-processing-assessment','services/auditory-processing-assessment',NULL,1,'2025-12-16 09:44:28','2025-12-16 09:44:28','176d38f3-a33b-43c6-80d3-7e480495d28f'),(755,755,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [743], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<p>If children are referred for an APD assessment, a comprehensive hearing assessment including pure tone audiometry, tympanometry and speech discrimination in quiet are performed to ensure normal hearing and healthy middle ears. The APD assessment then involves various tests to check the child\'s ability to listen to information presented simultaneously to both ears, their ability to hear in background noise and their ability to detect subtle differences in sound.</p><p>Using the information from the APD assessment, feedback from the childs teachers, parents and other specialists, a written report will be supplied with recommendations for management and/or intervention as appropriate. We accept all referrals for APD assessment; however, a medical referral will also be required to enable Medicare rebate for the hearing assessment.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\"}',1,'2025-12-16 09:44:28','2025-12-16 09:44:28','97cabd93-5a22-406f-a21c-c5e477122bbd'),(759,759,1,'Auditory Processing Assessment','auditory-processing-assessment','services/auditory-processing-assessment',NULL,1,'2025-12-16 09:47:05','2025-12-16 09:47:05','1f14fb26-adfc-469b-923d-2fa552568847'),(760,760,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [744], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h2>Hearing 4 Learning</h2><p>Educational Audiology assessments are available at our newest clinic at MPA, Hearing 4 Learning. Our clinicians, each with over 20 years experience in Paediatric Audiology have a special interest in Educational Audiology, working with the children along with parents and teachers to ensure an optimal listening environment for the childs learning.</p><h3>What is Auditory Processing Disorder?</h3><p>Auditory Processing Disorder is defined as a hearing deficit where the brain has difficulty understanding speech and other sounds in the environment. Children with APD most commonly report difficulty listening in noisy environments, however, it is more often learning delays or difficulties in the classroom that will trigger a referral for APD assessment</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-16 09:47:05','2025-12-16 09:47:05','9d8e5c85-66f1-4f18-8c0e-75111e544ae3'),(761,761,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [743], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<p>If children are referred for an APD assessment, a comprehensive hearing assessment including pure tone audiometry, tympanometry and speech discrimination in quiet are performed to ensure normal hearing and healthy middle ears. The APD assessment then involves various tests to check the child\'s ability to listen to information presented simultaneously to both ears, their ability to hear in background noise and their ability to detect subtle differences in sound.</p><p>Using the information from the APD assessment, feedback from the childs teachers, parents and other specialists, a written report will be supplied with recommendations for management and/or intervention as appropriate. We accept all referrals for APD assessment; however, a medical referral will also be required to enable Medicare rebate for the hearing assessment.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"logo\"}',1,'2025-12-16 09:47:05','2025-12-16 09:47:05','9616d7bd-edf3-4c2d-bceb-75a6cc6438b9'),(764,764,1,'Flower girl',NULL,NULL,NULL,1,'2025-12-16 09:51:21','2025-12-16 09:51:21','bc939e7c-fd97-4012-ab64-5698d68d09e0'),(765,765,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>What causes wax build up?</h3><p>Ear wax is perfectly normal. It is produced by the ear to help clean and protect itself from dirt and debris. Tiny glands in the skin in the ear canals secrete the wax to trap dust particles from entering further into your ear.</p><p>Excessive wax build up can occur just due to the shape of the ear canals, ear hair or due to wearing hearing aids. Unhealthy wax which irritates can be due to a chronic condition.</p><h3>What can your Audiologist do?</h3><p>We can examine and note the health of your ear canals. Simple wax can be removed suctioned and any chronic conditions will be referred to an ENT surgeon for appropriate care.</p><h3>What is Micro-suction?</h3><p>Using a Voroscope and a medical suction device, micro-suction is a very safe and comfortable method of removing wax. The wax is gently sucked from the ear canal. All Audiologists performing wax removal at MPA have undergone training in micro-suction technique.</p><p>Prior to your appointment, wax softener such as drops or olive oil is recommended. This will make wax removal easier and more efficient.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-16 09:51:28','2025-12-16 09:52:54','625a503d-d1e4-46dc-bbb0-a3ed46b3726a'),(766,766,1,'Wax Removal','wax-removal','services/wax-removal',NULL,1,'2025-12-16 09:51:28','2025-12-16 09:51:28','6b50d162-4dec-4a6f-a047-f8ad0affae64'),(767,767,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [764], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>What causes wax build up?</h3><p>Ear wax is perfectly normal. It is produced by the ear to help clean and protect itself from dirt and debris. Tiny glands in the skin in the ear canals secrete the wax to trap dust particles from entering further into your ear.</p><p>Excessive wax build up can occur just due to the shape of the ear canals, ear hair or due to wearing hearing aids. Unhealthy wax which irritates can be due to a chronic condition.</p><h3>What can your Audiologist do?</h3><p>We can examine and note the health of your ear canals. Simple wax can be removed suctioned and any chronic conditions will be referred to an ENT surgeon for appropriate care.</p><h3>What is Micro-suction?</h3><p>Using a Voroscope and a medical suction device, micro-suction is a very safe and comfortable method of removing wax. The wax is gently sucked from the ear canal. All Audiologists performing wax removal at MPA have undergone training in micro-suction technique.</p><p>Prior to your appointment, wax softener such as drops or olive oil is recommended. This will make wax removal easier and more efficient.</p>\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-16 09:51:28','2025-12-16 09:51:28','5b5168d0-ab62-44ab-8d0f-ef35e8ada5bb'),(770,770,1,'Wax Removal','wax-removal','services/wax-removal',NULL,1,'2025-12-16 09:51:56','2025-12-16 09:51:56','6eff4fc9-a352-4388-8177-364d0d99e8f7'),(771,771,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [764], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>What causes wax build up?</h3><p>Ear wax is perfectly normal. It is produced by the ear to help clean and protect itself from dirt and debris. Tiny glands in the skin in the ear canals secrete the wax to trap dust particles from entering further into your ear.</p><p>Excessive wax build up can occur just due to the shape of the ear canals, ear hair or due to wearing hearing aids. Unhealthy wax which irritates can be due to a chronic condition.</p><h3>What can your Audiologist do?</h3><p>We can examine and note the health of your ear canals. Simple wax can be removed suctioned and any chronic conditions will be referred to an ENT surgeon for appropriate care.</p><h3>What is Micro-suction?</h3><p>Using a Voroscope and a medical suction device, micro-suction is a very safe and comfortable method of removing wax. The wax is gently sucked from the ear canal. All Audiologists performing wax removal at MPA have undergone training in micro-suction technique.</p><p>Prior to your appointment, wax softener such as drops or olive oil is recommended. This will make wax removal easier and more efficient.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"logo\"}',1,'2025-12-16 09:51:56','2025-12-16 09:51:56','56cf0b29-741b-4f79-b18d-9ec14f375885'),(774,774,1,'Wax Removal','wax-removal','services/wax-removal',NULL,1,'2025-12-16 09:52:54','2025-12-16 09:52:54','3e11c07a-37ba-47fa-a963-b79ba6035696'),(775,775,1,NULL,NULL,NULL,'{\"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>What causes wax build up?</h3><p>Ear wax is perfectly normal. It is produced by the ear to help clean and protect itself from dirt and debris. Tiny glands in the skin in the ear canals secrete the wax to trap dust particles from entering further into your ear.</p><p>Excessive wax build up can occur just due to the shape of the ear canals, ear hair or due to wearing hearing aids. Unhealthy wax which irritates can be due to a chronic condition.</p><h3>What can your Audiologist do?</h3><p>We can examine and note the health of your ear canals. Simple wax can be removed suctioned and any chronic conditions will be referred to an ENT surgeon for appropriate care.</p><h3>What is Micro-suction?</h3><p>Using a Voroscope and a medical suction device, micro-suction is a very safe and comfortable method of removing wax. The wax is gently sucked from the ear canal. All Audiologists performing wax removal at MPA have undergone training in micro-suction technique.</p><p>Prior to your appointment, wax softener such as drops or olive oil is recommended. This will make wax removal easier and more efficient.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-16 09:52:54','2025-12-16 09:52:54','5dfe403b-1e51-418c-b682-55e2cbee0608'),(780,780,1,'Neuromonics logo',NULL,NULL,NULL,1,'2025-12-16 09:57:06','2025-12-16 09:57:06','92627ee8-9c61-4ffe-8c45-47dd208fc80d'),(781,781,1,'Lady beach',NULL,NULL,NULL,1,'2025-12-16 09:57:06','2025-12-16 09:57:06','01af3ef2-3542-4b70-bca8-b05012637629'),(782,782,1,'Magnifying glass',NULL,NULL,NULL,1,'2025-12-16 09:57:06','2025-12-16 09:57:06','975095ca-4647-4595-96f4-f0e7ff95352d'),(783,783,1,'History taking',NULL,NULL,NULL,1,'2025-12-16 09:57:07','2025-12-16 09:57:07','634b889c-dc1c-4c67-abc0-3d87c5ebd1e3'),(788,788,1,'What is Tinnitus?','what-is-tinnitus',NULL,'{\"8e7fd4c1-6568-4709-8942-b36520265656\": \"<p>Tinnitus is the perception of sound in the ear in the absence of external sound. It is commonly described as a ringing, buzzing, hissing, or sounding like \\\"crickets\\\". Although there is no cure for tinnitus, it can be successfully managed with various strategies. Tinnitus is actually quite common. 15-20% of the general population experience tinnitus and this increases to 30% in patients over 55.</p>\"}',1,'2025-12-16 10:03:43','2025-12-16 10:03:43','247f895a-2279-495a-8223-58e764ad6238'),(789,789,1,NULL,NULL,NULL,NULL,1,'2025-12-16 10:03:43','2025-12-16 10:03:43','b4331900-c271-4136-8b0a-4f8836e5a96b'),(790,790,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [783], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>The importance of History Taking</h3><p>Usually bilateral, symmetrical Tinnitus is not concerning and may well be due to age-related hearing loss. One-sided tinnitus may require further investigation so other pathologies can be excluded. If tinnitus is pulsatile it could be due to abnormal circulation.</p><p>A thorough history should be used to identify if Tinnitus has any concerning features. By doing so, any further investigations by your GP or an ENT specialist can be recommended.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-16 10:03:43','2025-12-16 10:03:43','dd70c968-e043-4f72-ab10-4f997fa5c1fe'),(791,791,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [782], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>What investigations could be done?</h3><p>Diagnostic hearing assessment is essential to assess hearing levels and middle ear function.</p><p>Following our assessment, if your doctor or ENT surgeon has any concerns, they may investigate for the following.</p><ul><li>Blood workup for metabolic causes</li><li>MRI to visualise the inner ear and hearing nerve</li><li>Doppler ultrasound of the neck</li></ul>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"left\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-16 10:03:43','2025-12-16 10:03:43','f933f3cd-d1df-4981-8a1c-3225e312b053'),(792,792,1,NULL,NULL,NULL,'{\"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>Problems associated with tinnitus</h3><p>Tinnitus can cause a variety of difficulties such as sleeping, poor concentration, sensitivity to loud noise, fatigue, depression, anxiety, stress, and difficulty relaxing. It can impact not only the person suffering from tinnitus but also those surrounding them. Tinnitus can affect work performance, our sense of wellbeing and our confidence.</p><h3>Can Tinnitus be cured?</h3><p>While there\'s no cure for most Tinnitus, this condition can be managed very well with appropriate advice and guidance. It can be managed so well that patients may not hear Tinnitus for long periods.</p><p>Avoidance of precipitants can help to reduce the loudness of tinnitus:</p><ul><li>stimulants  caffeine, smoking and alcohol</li><li>loud noise  occupational and recreational</li><li>certain drugs  aspirin and NSAIDs</li></ul><p>Medical intervention:</p><ul><li>doctors may treat insomnia, anxiety, and depression</li><li>combination of medication and counselling</li></ul>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-16 10:03:43','2025-12-16 10:03:43','68578f3c-8d75-413f-b49c-b09b7a82683c'),(793,793,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [781], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>What can MPA do for your tinnitus?</h3><p><strong>1. Masking and hearing aids</strong></p><ul><li>White Noise - from a radio or a home masking machine</li><li>Hearing Aids - if you have an aidable hearing loss wearing a hearing aid/s amplify ambient noise which masks Tinnitus. It also stops you straining to listen which can also improve tinnitus.</li><li>Tinnitus Maskers  deliver narrow-band noise centred around the pitch of your Tinnitus, at low intensity. The idea is to give your brain a sound outside of your own tinnitus to drown out the internal sound and switch the focus to the external noise.</li></ul><p><strong>2. Tinnitus retraining therapy</strong><br />This is a technique of habituation using a combination of masking with low-level broadband noise and  counselling to achieve habituation of the reaction to Tinnitus and the perception of the tinnitus signal itself</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"left\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-16 10:03:43','2025-12-16 10:03:43','5a626236-34ad-4cae-a04a-8e447c580f0f'),(794,794,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [780], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>Neuromonics Tinnitus Treatment</h3><p>The Neuromonics Tinnitus Treatment was developed at Curtain University in Western Australia. It uses a customised devise based on the patients extended audiogram to develop an individual tinnitus treatment prescription. This is designed to provide a pleasant acoustic signal embedded in music. This is designed to stimulate a wide range of the auditory pathway and to engage the limbic (emotional) system &amp; autonomic nervous system of the brain. The device is worn daily for at least 2-3 hours and over a period of approximately 26 weeks. It can decrease the disturbance caused by the tinnitus.</p><p>Angelique has undertaken training in Neuromonics treatment and has successfully helped many clients live better, sleep better and mange their tinnitus better. Make an appointment with her today.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"logo\"}',1,'2025-12-16 10:03:43','2025-12-16 10:03:43','3adde65e-4f3a-41c9-8401-7a9ab7dff45e'),(795,795,1,'Tinnitus Therapy','tinnitus-therapy','services/tinnitus-therapy',NULL,1,'2025-12-16 10:03:43','2025-12-16 10:03:43','54a0b8e7-428a-4c43-8eb1-340d9d252d35'),(796,796,1,'What is Tinnitus?','what-is-tinnitus',NULL,'{\"8e7fd4c1-6568-4709-8942-b36520265656\": \"<p>Tinnitus is the perception of sound in the ear in the absence of external sound. It is commonly described as a ringing, buzzing, hissing, or sounding like \\\"crickets\\\". Although there is no cure for tinnitus, it can be successfully managed with various strategies. Tinnitus is actually quite common. 15-20% of the general population experience tinnitus and this increases to 30% in patients over 55.</p>\"}',1,'2025-12-16 10:03:43','2025-12-16 10:03:43','1519a659-540c-4223-b03d-125654f23bc8'),(797,797,1,NULL,NULL,NULL,NULL,1,'2025-12-16 10:03:43','2025-12-16 10:03:43','c9662c85-e539-441d-a677-ae92e67632c2'),(798,798,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [783], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>The importance of History Taking</h3><p>Usually bilateral, symmetrical Tinnitus is not concerning and may well be due to age-related hearing loss. One-sided tinnitus may require further investigation so other pathologies can be excluded. If tinnitus is pulsatile it could be due to abnormal circulation.</p><p>A thorough history should be used to identify if Tinnitus has any concerning features. By doing so, any further investigations by your GP or an ENT specialist can be recommended.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-16 10:03:43','2025-12-16 10:03:43','1a80bb7f-f3ca-4f82-a423-a9144c588c34'),(799,799,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [782], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>What investigations could be done?</h3><p>Diagnostic hearing assessment is essential to assess hearing levels and middle ear function.</p><p>Following our assessment, if your doctor or ENT surgeon has any concerns, they may investigate for the following.</p><ul><li>Blood workup for metabolic causes</li><li>MRI to visualise the inner ear and hearing nerve</li><li>Doppler ultrasound of the neck</li></ul>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"left\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-16 10:03:43','2025-12-16 10:03:43','8948f21a-0b2f-4b4b-9edf-241b4a63885d'),(800,800,1,NULL,NULL,NULL,'{\"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>Problems associated with tinnitus</h3><p>Tinnitus can cause a variety of difficulties such as sleeping, poor concentration, sensitivity to loud noise, fatigue, depression, anxiety, stress, and difficulty relaxing. It can impact not only the person suffering from tinnitus but also those surrounding them. Tinnitus can affect work performance, our sense of wellbeing and our confidence.</p><h3>Can Tinnitus be cured?</h3><p>While there\'s no cure for most Tinnitus, this condition can be managed very well with appropriate advice and guidance. It can be managed so well that patients may not hear Tinnitus for long periods.</p><p>Avoidance of precipitants can help to reduce the loudness of tinnitus:</p><ul><li>stimulants  caffeine, smoking and alcohol</li><li>loud noise  occupational and recreational</li><li>certain drugs  aspirin and NSAIDs</li></ul><p>Medical intervention:</p><ul><li>doctors may treat insomnia, anxiety, and depression</li><li>combination of medication and counselling</li></ul>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-16 10:03:43','2025-12-16 10:03:43','b6974dd3-f420-4474-ad74-e2ff007e5bc5'),(801,801,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [781], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>What can MPA do for your tinnitus?</h3><p><strong>1. Masking and hearing aids</strong></p><ul><li>White Noise - from a radio or a home masking machine</li><li>Hearing Aids - if you have an aidable hearing loss wearing a hearing aid/s amplify ambient noise which masks Tinnitus. It also stops you straining to listen which can also improve tinnitus.</li><li>Tinnitus Maskers  deliver narrow-band noise centred around the pitch of your Tinnitus, at low intensity. The idea is to give your brain a sound outside of your own tinnitus to drown out the internal sound and switch the focus to the external noise.</li></ul><p><strong>2. Tinnitus retraining therapy</strong><br />This is a technique of habituation using a combination of masking with low-level broadband noise and  counselling to achieve habituation of the reaction to Tinnitus and the perception of the tinnitus signal itself</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"left\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-16 10:03:43','2025-12-16 10:03:43','bf9842b1-4762-42a5-ae43-d10124b70ca2'),(802,802,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [780], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>Neuromonics Tinnitus Treatment</h3><p>The Neuromonics Tinnitus Treatment was developed at Curtain University in Western Australia. It uses a customised devise based on the patients extended audiogram to develop an individual tinnitus treatment prescription. This is designed to provide a pleasant acoustic signal embedded in music. This is designed to stimulate a wide range of the auditory pathway and to engage the limbic (emotional) system &amp; autonomic nervous system of the brain. The device is worn daily for at least 2-3 hours and over a period of approximately 26 weeks. It can decrease the disturbance caused by the tinnitus.</p><p>Angelique has undertaken training in Neuromonics treatment and has successfully helped many clients live better, sleep better and mange their tinnitus better. Make an appointment with her today.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"logo\"}',1,'2025-12-16 10:03:43','2025-12-16 10:03:43','c8b26999-0570-4ecd-a779-eccecbf2e671'),(803,803,1,'Tinnitus Therapy','tinnitus-therapy','services/tinnitus-therapy',NULL,1,'2025-12-16 10:03:46','2025-12-16 10:03:46','b48b9dad-41f0-4f8e-85b0-4f860923859e'),(806,806,1,'Earplugs1',NULL,NULL,NULL,1,'2025-12-16 10:14:56','2025-12-16 10:14:56','bd4d7820-1973-41bf-9c4c-e1876a967d2f'),(807,807,1,'Earplugs2',NULL,NULL,NULL,1,'2025-12-16 10:14:56','2025-12-16 10:14:56','22b461ad-1e5d-473e-89cd-49598ab00192'),(810,810,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [806], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>Several types of ear plugs depending on your need</h3><p>At MPA we have many styles of ear plugs available for a variety of different needs.</p><ul><li>Water protection: for grommets, ear drum perforations or outer ear infection. These plugs will ensure your ears stay dry when swimming and showering.</li><li>Sleeping: get a peaceful night\'s sleep with a good ear plug fitting.</li><li>Noise cancelling: ideal for concerts, motor bike riding or noisy home maintenance. Protect your ears from harmful noise exposure</li><li>Musician\'s ear plugs: these are specially designed with filters to maintain the quality of sound but reduce the intensity to protect the ears from hearing loss.</li><li>Flying: these plugs are designed to assist with the reduction of ear pain associated with flying</li></ul>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"left\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"logo\"}',1,'2025-12-16 10:16:31','2025-12-16 10:16:31','d9ea302c-dc1f-4b31-ab1a-f2c7fce053b9'),(811,811,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [807], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>Choose your style</h3><p>Ear plugs are available in pre-moulded or custom moulded designs. Pre-moulded plugs come in a variety of sizes and your Audiologist will determine if it is a good fit for you. Alternatively the custom moulded plugs are made from the shape of your ear. The Audiologist will take a shape of your ear with some putty and then send it off to a manufacturer to create a mould that is specifically designed for you.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"logo\"}',1,'2025-12-16 10:16:31','2025-12-16 10:16:31','6df47ce6-3de5-4e10-839a-67924d85921e'),(812,812,1,'Ear Plugs','ear-plugs','services/ear-plugs',NULL,1,'2025-12-16 10:16:31','2025-12-16 10:16:31','89f4d8e8-6bee-429e-950b-8c0574d11cdf'),(813,813,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [806], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>Several types of ear plugs depending on your need</h3><p>At MPA we have many styles of ear plugs available for a variety of different needs.</p><ul><li>Water protection: for grommets, ear drum perforations or outer ear infection. These plugs will ensure your ears stay dry when swimming and showering.</li><li>Sleeping: get a peaceful night\'s sleep with a good ear plug fitting.</li><li>Noise cancelling: ideal for concerts, motor bike riding or noisy home maintenance. Protect your ears from harmful noise exposure</li><li>Musician\'s ear plugs: these are specially designed with filters to maintain the quality of sound but reduce the intensity to protect the ears from hearing loss.</li><li>Flying: these plugs are designed to assist with the reduction of ear pain associated with flying</li></ul>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"left\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"logo\"}',1,'2025-12-16 10:16:31','2025-12-16 10:16:31','d83b628d-08c2-43d3-a9e9-6760da601ad5'),(814,814,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [807], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>Choose your style</h3><p>Ear plugs are available in pre-moulded or custom moulded designs. Pre-moulded plugs come in a variety of sizes and your Audiologist will determine if it is a good fit for you. Alternatively the custom moulded plugs are made from the shape of your ear. The Audiologist will take a shape of your ear with some putty and then send it off to a manufacturer to create a mould that is specifically designed for you.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"logo\"}',1,'2025-12-16 10:16:31','2025-12-16 10:16:31','8fdcbe94-4585-457e-a6c8-482313d46fa0'),(815,815,1,'Ear Plugs','ear-plugs','services/ear-plugs',NULL,1,'2025-12-16 10:16:37','2025-12-16 10:16:37','baea0e56-3c64-4f5a-bad2-465c33bfde17'),(827,827,1,'Receiver canal',NULL,NULL,NULL,1,'2025-12-16 10:25:30','2025-12-16 10:25:30','6e8ab81d-4a0e-4f44-9c2e-39b74bb7b90f'),(828,828,1,'Behind the ear',NULL,NULL,NULL,1,'2025-12-16 10:25:30','2025-12-16 10:25:30','a3a79b3f-5d87-4a91-a63a-a6ae6ae4aed0'),(829,829,1,'Custom hearing aids',NULL,NULL,NULL,1,'2025-12-16 10:25:31','2025-12-16 10:25:31','42220fb7-4d0f-4fbb-8310-82443e4150b2'),(834,834,1,NULL,NULL,NULL,'{\"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>Benefits of Hearing Aids</h3><ul><li>Making sounds more audible therefore makes listening easier</li><li>Reducing listening effort could free up cognitive resources for purposes other than listening</li><li>Potentially reduce feeling of fatigue</li><li>Better performance on secondary tasks performed at the same time as primary tasks</li><li>More confidence in social settings, stay connected with friends and family</li><li>Easier listening on the phone</li><li>Increased enjoyment of music, TV, movies or theatre.</li></ul>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"left\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-16 10:27:34','2025-12-16 10:27:34','c7bab7f8-03c3-4cec-9784-efffbd7a818a'),(835,835,1,'10 ways to drive Hard of Hearing People CRAZY!','10-ways-to-drive-hard-of-hearing-people-crazy',NULL,NULL,1,'2025-12-16 10:27:34','2025-12-16 10:27:34','f49e4d2d-36a0-4109-a5d5-8a928adf5d5d'),(836,836,1,NULL,NULL,NULL,'{\"40b86b23-c546-4825-a38d-3760dc4f4539\": {\"type\": \"entry\", \"value\": \"{entry:204@1:url}\"}, \"b89ac503-3889-465b-b65e-ff6de2704a3e\": \"Read now\"}',1,'2025-12-16 10:27:34','2025-12-16 10:27:34','671cc530-4c94-45e8-bd65-28c7184ef001'),(837,837,1,NULL,NULL,NULL,'{\"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>Hearing Aid Styles</h3><p>If a hearing loss is diagnosed, hearing aids may be recommended. During the appointment, your Audiologist will discuss the following with you to determine the best fit hearing aid for you:</p><ul><li>Type and Degree of hearing loss</li><li>Speech Discrimination scores</li><li>History of ear infections or surgeries to the middle ear</li><li>Cosmetic Considerations</li><li>Listening Needs and Individual Lifestyle</li><li>Expectations and Motivation</li><li>Budget</li><li>Eligibility for Hearing Services Program (HSP)</li></ul>\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-16 10:27:34','2025-12-16 10:27:34','1925a078-9b39-446f-9fe5-252d62c98c66'),(838,838,1,NULL,NULL,NULL,'{\"8e7fd4c1-6568-4709-8942-b36520265656\": \"<p><strong>MPA are proudly independent and can supply and fit a large range of hearing aids and accessories from all hearing aid manufacturers.</strong></p>\"}',1,'2025-12-16 10:27:34','2025-12-16 10:27:34','703f7f86-d427-403f-8e6c-80f5c86e0bac'),(839,839,1,NULL,NULL,NULL,NULL,1,'2025-12-16 10:27:34','2025-12-16 10:27:34','8bab3fae-b2aa-403a-969d-05fec971daa5'),(840,840,1,NULL,NULL,NULL,'{\"5f8f84f5-06d0-4eda-83ca-2403830873c6\": \"logo\", \"ea005bfa-5e15-4b1f-9474-c4927c9653f5\": 3}',1,'2025-12-16 10:27:34','2025-12-16 10:27:34','2bac0c00-3774-426b-89a4-47de8aded7fc'),(841,841,1,'Custom Hearing Aids','custom-hearing-aids',NULL,'{\"68f1a6a0-f29b-43e4-ac34-e62987515a8b\": [829], \"86f5c4b