,1,'2025-12-17 10:05:06','2025-12-17 10:05:06','faa8c177-e30c-4f8c-a3dc-e737b25b1090'),(924,924,1,NULL,NULL,NULL,NULL,1,'2025-12-17 10:05:06','2025-12-17 10:05:06','15c197f2-1f60-46e4-bb18-c42e0514dc8e'),(927,927,1,NULL,NULL,NULL,'{\"3bdce705-01c8-430d-9803-399475ce8db0\": \"<h3 style=\\\"text-align:center;\\\">Hearing is important to maintain health and wellbeing</h3><p style=\\\"text-align:center;\\\">No matter the patient\'s age, untreated hearing loss can have a negative impact on physical and mental health. Persistent hearing loss in children can result in speech and language, educational and behavioural delays. In adults we observe early onset dementia and cognitive decline due to the isolation hearing loss causes. At MPA, we believe quality of life for all our patients is top priority. With the results obtained from our comprehensive assessment, we develop a management plan in consultation with your doctor to best manage your hearing needs.</p>\"}',1,'2025-12-17 10:08:01','2025-12-17 10:08:01','da5e157b-b56f-47a3-9633-04fbf3b71c0a'),(928,928,1,'Hearing for Health','hearing-for-health','hearing-for-health',NULL,1,'2025-12-17 10:08:01','2025-12-17 10:08:01','55f55075-3bba-4300-b748-e270fdfdcd2a'),(929,929,1,NULL,NULL,NULL,'{\"3bdce705-01c8-430d-9803-399475ce8db0\": \"<h3 style=\\\"text-align:center;\\\">Hearing is important to maintain health and wellbeing</h3><p style=\\\"text-align:center;\\\">No matter the patient\'s age, untreated hearing loss can have a negative impact on physical and mental health. Persistent hearing loss in children can result in speech and language, educational and behavioural delays. In adults we observe early onset dementia and cognitive decline due to the isolation hearing loss causes. At MPA, we believe quality of life for all our patients is top priority. With the results obtained from our comprehensive assessment, we develop a management plan in consultation with your doctor to best manage your hearing needs.</p>\"}',1,'2025-12-17 10:08:01','2025-12-17 10:08:01','10a1d210-31cb-49a8-9456-9442485bd57d'),(930,930,1,'Hearing for Health','hearing-for-health','hearing-for-health',NULL,1,'2025-12-17 10:08:03','2025-12-17 10:08:03','5f4b9bf4-2790-4871-9fa7-28c5dd5cafd4'),(934,934,1,'Hearing for Health','hearing-for-health','hearing-for-health',NULL,1,'2025-12-17 10:08:53','2025-12-17 10:08:53','d02f26a4-9d5f-4336-b2c9-d2e23aa599b1'),(935,935,1,NULL,'services',NULL,NULL,1,'2025-12-17 10:08:53','2025-12-17 10:08:53','d7ed0dac-b636-460e-8332-c3fd2cb31bab'),(936,936,1,'How We Hear','hearing-aids',NULL,'{\"084b381c-67b3-455a-a99b-9eae3e76d1ff\": [406], \"6c77f445-0455-4050-ba36-5e9cf10efc94\": {\"type\": \"entry\", \"value\": \"{entry:194@1:url}\"}, \"c12c5cc9-3b6b-4341-acda-efa17882a7ee\": \"#00a7ea\"}',1,'2025-12-17 10:08:53','2025-12-17 10:08:53','59871a88-fa3b-4392-9357-42753094368a'),(939,939,1,'Otitis media ear diagram',NULL,NULL,NULL,1,'2025-12-17 10:13:09','2025-12-17 10:13:09','2605cd32-3726-43d6-9cae-8db717693b0d'),(946,946,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [939], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>What is Otitis Media?</h3><p>Otitis Media is fluid build up in the middle ear. The middle ear is the space behind the eardrum which usually air filled. The middle ear contains 3 tiny bones called the ossicles which help to transmit sound to the auditory nerve. There is a pressure valve that controls the air in the middle ear and its pressure which is called the Eustachian tube. The eustachian tube connects the ear to the back of the nose. If the Eustachian tube becomes blocked, air cannot enter the middle ear and the fluid produced by the lining of the middle ear becomes trapped. The fluid can be runny like water or thick almost like \'glue\' This is known as \'glue ear\'. The longer the eustachian tube remains blocked, the greater the risk of middle ear infection.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-17 10:17:16','2025-12-17 10:17:16','03ac41bc-b7e3-4feb-a04a-9c2143f26439'),(947,947,1,NULL,NULL,NULL,'{\"3bdce705-01c8-430d-9803-399475ce8db0\": \"<h3>What is Otitis Media?</h3><p>Otitis media is an infection or inflammation of the middle ear. In children, it is a common condition that can occur as a result of a cold or other upper respiratory infection. The infection can cause fluid build up in the middle ear, which can lead to pain, fever and difficulty hearing. In some cases, there is enough pressure in the middle ear to cause a rupture of the ear drum (perforation). Otitis media is typically treated with antibiotics. In some cases, if the fluid is persistent and is causing fluctuating hearing loss, pain and/or speech delay, the child may need to have the fluid drained from the middle ear.</p>\"}',1,'2025-12-17 10:17:16','2025-12-17 10:17:16','1ba3a98f-ba2a-49d5-b1bf-b9fa8f49e5ba'),(948,948,1,NULL,NULL,NULL,'{\"3bdce705-01c8-430d-9803-399475ce8db0\": \"<h3>How common is Otitis Media in Children?</h3><p>Otitis media is a very common condition in children, It is estimated that around 75% of children will have at least one episode of otitis media before they reach the age of three. Increased incidence of otitis media is observed in children under 2. It can be caused by a variety of factors including colds, allergies and exposure to cigarette smoke.</p>\"}',1,'2025-12-17 10:17:16','2025-12-17 10:17:16','6e253a66-4e35-4031-98bc-fefd6e1740ff'),(949,949,1,NULL,NULL,NULL,'{\"3bdce705-01c8-430d-9803-399475ce8db0\": \"<h3>Are there complications of Otitis Media?</h3><p>With antibiotics and modern surgical treatments, complications are very rare.</p><p>If untreated, long term otitis media could result in:</p><ol><li>Hearing Loss: prolonged inflammation may cause temporary and sometimes permanent damage to the eardrum and middle ear bones.</li><li>Speech and language delays: most often a side effect of fluctuating hearing loss, children may experience delays in speech development.</li><li>Mastoiditis: this is a severe infection of the mastoid bone behind the ear, This can lead to severe illness and permanent hearing loss.</li><li>Perforation of the eardrum: The ear drum can be perforated due to the pressure caused by the fluid accumulation in the middle ear. This can be very painful and may lead to permanent hearing loss.</li><li>Cholesteatoma: this is a growth that can occur behind the eardrum and can lead to chronic infections and permanent hearing loss.</li></ol>\"}',1,'2025-12-17 10:17:16','2025-12-17 10:17:16','efd28492-6ab8-4014-889d-1fb0ae2e860a'),(950,950,1,NULL,NULL,NULL,'{\"3bdce705-01c8-430d-9803-399475ce8db0\": \"<h3>What Symptoms &amp; Signs should I look out for?</h3><ul><li>Hearing loss</li><li>Fever</li><li>Discharge from the ear which could indicate a perforation (hole)</li><li>Irritability, poor sleep</li><li>Poor language development</li><li>Concerns at school</li><li>Distress with loud noises such as hand dryers, blenders</li></ul>\"}',1,'2025-12-17 10:17:16','2025-12-17 10:17:16','f88d73b9-e52b-402f-9d3f-ec4b8db2b9cc'),(951,951,1,NULL,NULL,NULL,'{\"3bdce705-01c8-430d-9803-399475ce8db0\": \"<h3>What can the Audiologist do?</h3><p>Your MPA Audiologist will perform a middle ear pressure check (tympanogram) to measure the ear drum movement. We will also conduct a comprehensive hearing test to assess you or your child\'s hearing ability. If there is hearing loss and abnormal middle ear function likely due to otitis media, we will recommend further management by your family doctor. A review hearing test may be recommended to determine if it is a persistent problem.</p>\"}',1,'2025-12-17 10:17:16','2025-12-17 10:17:16','0bcbbf4e-0a9a-4dea-8292-40602fb96af2'),(952,952,1,NULL,NULL,NULL,'{\"3bdce705-01c8-430d-9803-399475ce8db0\": \"<h3>Can Otitis Media be fixed?</h3><p>Otitis Media can resolve on its own. However, if your child\'s otitis media is considered to be persistent, referral to an Ear, Nose and Throat specialist may be recommended. This can be arranged by your GP. The ENT surgeon may suggest a minor surgery to insert Middle ear ventilation tubes or grommets. Grommets are tiny little plastic tubes that are inserted into the ear drum to help prevent the otitis media from building up. The grommets remain in the ear drum for 6-12 months and fall out on their own.</p>\"}',1,'2025-12-17 10:17:16','2025-12-17 10:17:16','7dd2c08f-25cd-41a0-98b0-717cf3a69b55'),(953,953,1,'Otitis Media in Children','otitis-media-in-children','hearing-for-health/otitis-media-in-children',NULL,1,'2025-12-17 10:17:16','2025-12-17 10:17:16','c6ad170f-d6ec-4603-8f20-4b9cf74d9e2e'),(954,954,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [939], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>What is Otitis Media?</h3><p>Otitis Media is fluid build up in the middle ear. The middle ear is the space behind the eardrum which usually air filled. The middle ear contains 3 tiny bones called the ossicles which help to transmit sound to the auditory nerve. There is a pressure valve that controls the air in the middle ear and its pressure which is called the Eustachian tube. The eustachian tube connects the ear to the back of the nose. If the Eustachian tube becomes blocked, air cannot enter the middle ear and the fluid produced by the lining of the middle ear becomes trapped. The fluid can be runny like water or thick almost like \'glue\' This is known as \'glue ear\'. The longer the eustachian tube remains blocked, the greater the risk of middle ear infection.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-17 10:17:16','2025-12-17 10:17:16','2e593167-04c0-47be-a8c6-d8f05e5bd039'),(955,955,1,NULL,NULL,NULL,'{\"3bdce705-01c8-430d-9803-399475ce8db0\": \"<h3>What is Otitis Media?</h3><p>Otitis media is an infection or inflammation of the middle ear. In children, it is a common condition that can occur as