ear drum for 6-12 months and fall out on their own.</p>\"}',1,'2025-12-17 10:17:17','2025-12-17 10:17:17','3818567b-fef1-4e15-9dc1-d008477466e4'),(961,961,1,'Otitis Media in Children','otitis-media-in-children','hearing-for-health/otitis-media-in-children',NULL,1,'2025-12-17 10:17:19','2025-12-17 10:17:19','b9beb93d-9f2d-479c-89ec-a73a528acfc5'),(964,964,1,'Nightclub',NULL,NULL,NULL,1,'2025-12-17 10:24:19','2025-12-17 10:24:19','2d72796d-e365-467f-ad8c-8b646f48ce56'),(965,965,1,'Hearing protection',NULL,NULL,NULL,1,'2025-12-17 10:24:20','2025-12-17 10:24:20','2df85d01-9c85-4c1f-81fc-d39fd7bc484d'),(966,966,1,'Shooting',NULL,NULL,NULL,1,'2025-12-17 10:24:20','2025-12-17 10:24:20','561acf54-5cad-4ee5-b44b-10da9057c38a'),(969,969,1,'Hearing for Health','hearing-for-health','hearing-for-health',NULL,1,'2025-12-17 10:24:44','2025-12-17 10:24:44','8010d9bc-00bc-45bf-9f5a-e33f8c0e1a05'),(970,970,1,NULL,'services',NULL,NULL,1,'2025-12-17 10:24:44','2025-12-17 10:24:44','23ccf733-045c-4316-b934-46ed95e7baa5'),(971,971,1,'Otitis Media in Children','auditory-processing-assessment',NULL,'{\"084b381c-67b3-455a-a99b-9eae3e76d1ff\": [744], \"6c77f445-0455-4050-ba36-5e9cf10efc94\": {\"type\": \"entry\", \"value\": \"{entry:196@1:url}\"}, \"c12c5cc9-3b6b-4341-acda-efa17882a7ee\": \"#16baad\"}',1,'2025-12-17 10:24:44','2025-12-17 10:24:44','d9133fe4-8701-4f9b-ac53-9428d4fb74dd'),(972,972,1,'Noise, Hearing Loss and Hearing Protection','tinnitus-therapy',NULL,'{\"084b381c-67b3-455a-a99b-9eae3e76d1ff\": [966], \"6c77f445-0455-4050-ba36-5e9cf10efc94\": {\"type\": \"entry\", \"value\": \"{entry:200@1:url}\"}, \"c12c5cc9-3b6b-4341-acda-efa17882a7ee\": \"#c8df8a\"}',1,'2025-12-17 10:24:45','2025-12-17 10:24:45','41cfb128-ecd2-47aa-b71e-a876354860ab'),(978,978,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [966], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>What is noise-induced hearing loss?</h3><p>Noise-induced hearing loss (NIHL) can occur when sounds are too loud. These sounds can damage the hair cells in the inner ear and cause noise-induced hearing loss (NIHL). The hearing loss can be immediate or over a long period of time. It can be temporary or permanent. Generally the more exposure to the loud noise, the more damage is done to the ears.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-17 10:27:38','2025-12-17 10:27:38','5fbcc70c-1e7f-4981-beef-c0921c86c881'),(979,979,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [964], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>How loud is too loud?</h3><p>In general, the advice from experts is that people are advised against prolonged exposure to any sound above 85 decibels. However, it does depend on how long and how often the person is exposed. In general, the louder the sound, the shorter the time for NIHL to occur.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"left\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-17 10:27:38','2025-12-17 10:27:38','bf61675d-f1af-482d-86c2-19b6679fe1d6'),(980,980,1,NULL,NULL,NULL,'{\"3bdce705-01c8-430d-9803-399475ce8db0\": \"<h3>How do I know if I have damaged my hearing?</h3><p>Hearing loss due to noise exposure can occur slowly over a long period of time. As the damage from noise exposure is usually gradual, you might not notice it until it becomes more pronounced. Over time, you may find it more difficult to understand other people when they talk or have to turn up the volume on the TV. Sometimes the damage from NIHL, combined with wear and tear over the years, may mean the hearing loss is severe enough that hearing aids may be required to help you hear. Sometimes if the hearing loss is a result of exposure through your workplace, compensation may be available through Work Cover. Our Audiologists are registered to provide hearing services through WorkCover.</p>\"}',1,'2025-12-17 10:27:38','2025-12-17 10:27:38','5c88ea0e-8175-4267-b85b-0b8b8ed02285'),(981,981,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [965], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>Hearing Protection</h3><p>As Audiologists, we recommend hearing protection whenever you are exposed to loud noises regardless of how long the exposure. This would include activities such as lawn mowing, chain sawing, seeing a band or riding a motorcycle. As such there are a variety of different types of hearing protection on the market. These can be ear muffs or ear plugs which can be purchased off the shelf. Alternatively there are custom made plugs which can be made specifically for the individual with filters for musicians or unfiltered for maximum noise protection.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-17 10:27:38','2025-12-17 10:27:38','ba4475b4-2475-4b65-86a2-7c76bfac6f09'),(982,982,1,'Noise, Hearing Loss and Hearing Protection','noise-hearing-loss-and-hearing-protection','hearing-for-health/noise-hearing-loss-and-hearing-protection',NULL,1,'2025-12-17 10:27:38','2025-12-17 10:27:38','efb4ae0b-a1ca-4951-924c-6c8c68cc4c2c'),(983,983,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [966], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>What is noise-induced hearing loss?</h3><p>Noise-induced hearing loss (NIHL) can occur when sounds are too loud. These sounds can damage the hair cells in the inner ear and cause noise-induced hearing loss (NIHL). The hearing loss can be immediate or over a long period of time. It can be temporary or permanent. Generally the more exposure to the loud noise, the more damage is done to the ears.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-17 10:27:38','2025-12-17 10:27:38','7d0124f2-4604-4f2f-be7b-6b17308c65b3'),(984,984,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [964], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>How loud is too loud?</h3><p>In general, the advice from experts is that people are advised against prolonged exposure to any sound above 85 decibels. However, it does depend on how long and how often the person is exposed. In general, the louder the sound, the shorter the time for NIHL to occur.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"left\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-17 10:27:38','2025-12-17 10:27:38','9346b432-1679-4b11-a2f5-1868857da216'),(985,985,1,NULL,NULL,NULL,'{\"3bdce705-01c8-430d-9803-399475ce8db0\": \"<h3>How do I know if I have damaged my hearing?</h3><p>Hearing loss due to noise exposure can occur slowly over a long period of time. As the damage from noise exposure is usually gradual, you might not notice it until it becomes more pronounced. Over time, you may find it more difficult to understand other people when they talk or have to turn up the volume on the TV. Sometimes the damage from NIHL, combined with wear and tear over the years, may mean the hearing loss is severe enough that hearing aids may be required to help you hear. Sometimes if the hearing loss is a result of exposure through your workplace, compensation may be available through Work Cover. Our Audiologists are registered to provide hearing services through WorkCover.</p>\"}',1,'2025-12-17 10:27:38','2025-12-17 10:27:38','3f9e2dac-69e3-4a61-af6f-d1cedcbd0a97'),(986,986,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [965], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>Hearing Protection</h3><p>As Audiologists, we recommend hearing protection whenever you are exposed to loud noises regardless of how long the exposure. This would include activities such as lawn mowing, chain sawing, seeing a band or riding a motorcycle. As such there are a variety of different types of hearing protection on the market. These can be ear muffs or ear plugs which can be purchased off the shelf. Alternatively there are custom made plugs which can be made specifically for the individual with filters for musicians or unfiltered for maximum noise protection.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-17 10:27:38','2025-12-17 10:27:38','33ffd071-1880-454b-9c46-297123c0dd52'),(987,987,1,'Noise, Hearing Loss and Hearing Protection','noise-hearing-loss-and-hearing-protection','hearing-for-health/noise-hearing-loss-and-hearing-protection',NULL,1,'2025-12-17 10:27:40','2025-12-17 10:27:40','bebcd3bc-6753-4eff-a838-0136f6ef3fc9'),(990,990,1,'Audiologists desk',NULL,NULL,NULL,1,'2025-12-17 10:35:18','2025-12-17 10:35:18','f19ecb30-47a7-4bc0-80a6-4fa4b6d16854'),(991,991,1,NULL,'__temp_wgdfnehoakgogfzmekprvvkhbdcnsvvpuhqf',NULL,'{\"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-17 10:35:42','2025-12-17 10:35:42','9110c3da-50f4-43c7-9660-c7eed7a64352'),(993,993,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [990], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>About Mornington Peninsula Audiology</h3><p>Established in 2019, Mornington Peninsula Audiology is an independent audiology practice for the community of the Mornington Peninsula. Owners, Angelique Meulenkamp and Andrew McGaffin have both been audiologists for more than 15 years, they live on the Peninsula with their families and want to bring a personal approach to providing hearing services. They are supported by ENT surgeons and GPs throughout the Peninsula.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-17 10:36:29','2025-12-17 10:36:29','4c5cf693-9a5f-4b33-9b41-2d837dab5c5b'),(994,994,1,NULL,NULL,NULL,'{\"3bdce705-01c8-430d-9803-399475ce8db0\": \"<h3 style=\\\"text-align:center;\\\">Meet the Team</h3><p style=\\\"text-align:center;\\\"><strong>Dedication. Expertise. Passion.</strong></p><p style=\\\"text-align:center;\\\">Mornington Peninsula Audiology employs university qualified Audiologists with extensive training. All Audiologists hold clinical certification with the Audiology Society of Australia.</p>\"}',1,'2025-12-17 10:36:29','2025-12-17 10:36:29','bad0684f-ddfc-4ca5-8f4b-11dcdcba9535'),(995,995,1,'About us','about-us','about-us',NULL,1,'2025-12-17 10:36:29','2025-12-17 10:36:29','fca5147f-2159-4df2-ba28-0fb5f41833aa'),(996,996,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [990], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<h3>About Mornington Peninsula Audiology</h3><p>Established in 2019, Mornington Peninsula Audiology is an independent audiology practice for the community of the Mornington Peninsula. Owners, Angelique Meulenkamp and Andrew McGaffin have both been audiologists for more than 15 years, they live on the Peninsula with their families and want to bring a personal approach to providing hearing services. They are supported by ENT surgeons and GPs throughout the Peninsula.</p>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"right\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-17 10:36:29','2025-12-17 10:36:29','a3c984b0-a442-4a02-8a77-ec2e52594418'),(997,997,1,NULL,NULL,NULL,'{\"3bdce705-01c8-430d-9803-399475ce8db0\": \"<h3 style=\\\"text-align:center;\\\">Meet the Team</h3><p style=\\\"text-align:center;\\\"><strong>Dedication. Expertise. Passion.</strong></p><p style=\\\"text-align:center;\\\">Mornington Peninsula Audiology employs university qualified Audiologists with extensive training. All Audiologists hold clinical certification with the Audiology Society of Australia.</p>\"}',1,'2025-12-17 10:36:29','2025-12-17 10:36:29','08f99829-dfeb-45a4-bbb4-d780e376b782'),(998,998,1,'About us','about-us','about-us',NULL,1,'2025-12-17 10:36:41','2025-12-17 10:36:41','658d24eb-bea7-4e8d-b7b4-20bc0a77abbc'),(1001,1001,1,'Megaphone',NULL,NULL,NULL,1,'2025-12-17 10:40:54','2025-12-17 10:40:54','b660c6de-74cf-48b6-9b51-9586d51f4b35'),(1003,1003,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [1001], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<ol><li>Tell them they are not listening</li><li>Turn or walk away while having a conversation</li><li>Talk while eating</li><li>Talk at them while you are in another room</li><li>If they ask you to repeat yourself say Dont worry about it</li><li>Treat them as if they are hard of understanding, not hard of hearing</li><li>Leave them out of conversations</li><li>Tell them You hear me when you want to</li><li>Cover your mouth while you are talking</li><li>Get frustrated/angry when they struggle to hear</li></ol>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"left\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-17 10:41:07','2025-12-17 10:41:07','ccddf335-35c1-4da2-b0a6-dc32807f81d2'),(1004,1004,1,'10 Ways to Drive Hard of Hearing People CRAZY!','10-ways-to-drive-hard-of-hearing-people-crazy','10-ways-to-drive-hard-of-hearing-people-crazy',NULL,1,'2025-12-17 10:41:07','2025-12-17 10:41:07','8f61a301-c07b-4dac-a25e-74e8aec959bd'),(1005,1005,1,NULL,NULL,NULL,'{\"53834363-bc47-4a06-a754-6ac7c753cb8c\": [1001], \"56c3390b-899b-49af-8ceb-c2519f21b219\": \"<ol><li>Tell them they are not listening</li><li>Turn or walk away while having a conversation</li><li>Talk while eating</li><li>Talk at them while you are in another room</li><li>If they ask you to repeat yourself say Dont worry about it</li><li>Treat them as if they are hard of understanding, not hard of hearing</li><li>Leave them out of conversations</li><li>Tell them You hear me when you want to</li><li>Cover your mouth while you are talking</li><li>Get frustrated/angry when they struggle to hear</li></ol>\", \"7d8017ec-cbf5-40a0-9dd0-c98ac85507fb\": \"left\", \"887bd55c-d26e-42f1-8279-0aa3f82ed559\": \"photo\"}',1,'2025-12-17 10:41:07','2025-12-17 10:41:07','07af0892-9521-4157-a4f7-02e7a6579230'),(1006,1006,1,'10 Ways to Drive Hard of Hearing People CRAZY!','10-ways-to-drive-hard-of-hearing-people-crazy','10-ways-to-drive-hard-of-hearing-people-crazy',NULL,1,'2025-12-17 10:41:18','2025-12-17 10:41:18','ee9e850e-261a-4600-a26b-7ad33d7c32d3');
